import { put, takeLatest } from "@redux-saga/core/effects";
import { DISCONECT } from "../reducer/chatApp.const";

function* disconectSaga(data) {
    try {
        yield put({
            type: DISCONECT,
            payload: data,
        })
    } catch (error) {
        console.log(error);
    }
}

export function* disconectSagaAction() {
    yield takeLatest('disconectSaga', disconectSaga)
}
